import React from 'react'
import BasePageWithCard from './BasePageWithCard'
import SupervisedStudentsCard from '../components/SupervisedStudentsCard/SupervisedStudentsCard'

function SupervisedStudents({teacherData, requestData}) {
  return (
    <BasePageWithCard isAuthenticated={true} data={teacherData}>
    <SupervisedStudentsCard teacherData={teacherData} requestData={requestData}/>
    </BasePageWithCard>
  )
}

export default SupervisedStudents
